1.#สมองสร้างเคมีสุข
สมองเป็นหัวเรือของร่างกายเมื่อสมองสดชื่นและได้รับการพักผ่อนอย่างเพียงพอสมองก็จะทำงานได้อย่างเต็มที่และยังมีเคมีที่ทำให้ร่างกายทำงานได้ราบรื่นยิ่งขึ้น

2.#สร้างเคมีหนุ่มสาว
เคมีหนุ่มสาวที่เรียกว่า"โกสฮอร์โมน"จะช่วยให้ดูอ่อนเยาว์ 

3.ความจำดีขึ้น
การนอนดึกมีผลต่อความจำเป็นอย่างมากยิ่งถ้าเราอดหลับอดนอนแล้วยิ่งทำให้ความจำลดลงการทำงานของสมองก็ลดลงถ้าเราอดนอนเราจะรู้สึกมึนลืมง่ายไม่ก็ลิ้นพันกัน การนอนไวจึงช่วยให้สมองได้ชาร์จพลังงานอย่างเต็มที่

4.ซ่อมร่างที่สึกหรอ
ในเวลานอนคือช่วงที่ร่างกายซ่อมแซมตัวเองได้ดีที่สุดดังนั้นยิ่งนอนไวก็จะช่วยให้ร่างกายซ่อมแซมตัวเองได้อย่างดี

5.ลดความอ้วน
การนอนดึกยิ่งทำให้การเผาผลาญลดลงทำให้ไขมันที่ควรจะถูกเผาผลาญมันยังคงอยู่ทำให้เกิดสภาวะโลกอ้วนมากขึ้นในปัจจุบัน

6.ล้างพิษ
นอนไวจะช่วยขับล้างสารพิษได้ดีขึ้นไม่ต้องพึ่งดีท็อกเพราะร่างกายนั้นสามารถขับสารพิษในร่างกายได้ระดับหนึ่งช่วยให้ระบบขับถ่ายไม่มีปัญหารวมถึงปัญหาอื่นๆด้วยจ้า

7.กันแก่
ไม่อยากแก่รีบชวนกันนอนตั้งแต่หัวค่ำพอแค่นอนก็ช่วยเสริมสร้างความหนุ่มสาวและช่วยให้ระบบทั้งหลายไม่ทำร้ายร่างกายก่อนวัยอันควร

